    def isqrt(num: int) -> int:
        (res, bit) = (0, 1)
        while bit < num:
            bit <<= 2
        bit >>= 2
        while bit:
            if num >= res + bit:
                num -= res + bit
                res += bit << 1
            res >>= 1
            bit >>= 2
        return res

    def factorize(n: int) -> list:
        factors = []
        for q in (2, 3):
            m = 0
            while not n % q:
                m += 1
                n //= q
            if m:
                factors.append((q, m))
        (m, d, q, maxq) = (0, 4, 1, isqrt(n))
        while q <= maxq:
            (q, d) = (q + d, 6 - d)
            while not n % q:
                m += 1
                n //= q
            if m:
                factors.append((q, m))
                (m, d, q, maxq) = (0, 4, 1, isqrt(n))
        if n > 1:
            factors.append((n, 1))
        return factors

    def count_factor(n: int, f: int) -> int:
        s = 0
        while n >= f:
            n //= f
            s += n
        return s
